import React, { useState } from 'react';
import './SignUpFormModal.css'; // Include the styling

const SignUpFormModal = ({ onClose }) => {
  const [formData, setFormData] = useState({
    userType: '',
    firstName: '',
    lastName: '',
    email: '',
    mobile: '',
    password: '',
    confirmPassword: ''
  });

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Add form validation logic here
    console.log(formData);
  };

  return (
    <div className="modal-backdrop signup-modal">
      <div className="modal-content signup-modal-content">
        <button className="close-btn signup-close-btn" onClick={onClose}>X</button>
        <h2>Register Your Account</h2>
        <p className="form-info signup-form-info">
          New user? Please take a min to fill in your information. You will only have to do this once. We promise!
        </p>
        <form onSubmit={handleSubmit} className="signup-form">
          <div className="form-group signup-form-group">
            <label>User Type*</label>
            <select name="userType" value={formData.userType} onChange={handleInputChange} required>
              <option value="">Select User type</option>
              <option value="buyer">Buyer</option>
              <option value="agent">Agent</option>
              <option value="seller">Seller</option>
            </select>
          </div>
          <div className="form-group signup-form-group">
            <input
              type="text"
              name="firstName"
              placeholder="First Name"
              value={formData.firstName}
              onChange={handleInputChange}
              required
            />
            <input
              type="text"
              name="lastName"
              placeholder="Last Name"
              value={formData.lastName}
              onChange={handleInputChange}
              required
            />
          </div>
          <div className="form-group signup-form-group">
            <input
              type="email"
              name="email"
              placeholder="Email Address"
              value={formData.email}
              onChange={handleInputChange}
              required
            />
            <input
              type="text"
              name="mobile"
              placeholder="Mobile Number"
              value={formData.mobile}
              onChange={handleInputChange}
              required
            />
          </div>
          <div className="form-group signup-form-group">
            <input
              type="password"
              name="password"
              placeholder="Password"
              value={formData.password}
              onChange={handleInputChange}
              required
            />
            <input
              type="password"
              name="confirmPassword"
              placeholder="Confirm Password"
              value={formData.confirmPassword}
              onChange={handleInputChange}
              required
            />
          </div>
          <div className="form-group signup-form-group">
            <input type="checkbox" required />
            <label>I'm not a robot</label>
          </div>
          <button type="submit" className="sign-up-btn signup-btn">Sign Up</button>
        </form>
        <p className="login-link signup-login-link">
          Already Registered User? <a href="/login">Login</a>
        </p>
      </div>
    </div>
  );
};

export default SignUpFormModal;
